DROP TABLE IF EXISTS `user`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!50503 SET character_set_client = utf8mb4 */;
CREATE TABLE `user` (
  `user_id` int NOT NULL AUTO_INCREMENT,
  `email` varchar(50) NOT NULL,
  `name` varchar(20) NOT NULL,
  `password` varchar(150) NOT NULL,
  `profile_image` varchar(255) DEFAULT NULL,
  `nick_name` varchar(20) DEFAULT NULL,
  `phone` varchar(20) DEFAULT NULL,
  `address` varchar(100) DEFAULT NULL,
  `join_date` datetime NOT NULL,
  `auth` varchar(20) NOT NULL,
  `login` tinyint NOT NULL DEFAULT '0',
  `room_id` int NOT NULL DEFAULT '-1',
  `dept_id` int NOT NULL,
  `job_id` int NOT NULL,
  `office_id` int NOT NULL,
  `retire_date` datetime DEFAULT NULL,
  PRIMARY KEY (`user_id`),
  UNIQUE KEY `email_UNIQUE` (`email`),
  KEY `user_fk_roomId_idx` (`room_id`) /*!80000 INVISIBLE */,
  KEY `user_fk_belongId_idx` (`dept_id`) /*!80000 INVISIBLE */,
  KEY `user_fk_positionId_idx` (`job_id`) /*!80000 INVISIBLE */,
  KEY `user_fk_offiecId_idx` (`office_id`),
  CONSTRAINT `user_fk_deptId` FOREIGN KEY (`dept_id`) REFERENCES `department` (`dept_id`),
  CONSTRAINT `user_fk_jobId` FOREIGN KEY (`job_id`) REFERENCES `job` (`job_id`),
  CONSTRAINT `user_fk_offiecId` FOREIGN KEY (`office_id`) REFERENCES `office` (`office_id`),
  CONSTRAINT `user_fk_roomId` FOREIGN KEY (`room_id`) REFERENCES `room` (`room_id`)
) ENGINE=InnoDB AUTO_INCREMENT=105 DEFAULT CHARSET=utf8mb3;
/*!40101 SET character_set_client = @saved_cs_client */;

